    <script>

      var geocoder;
      var map;
      var markersArray = [];
      var infowindow = new google.maps.InfoWindow();
      
      function initialize() {

        //console.log(agenciesMap())

        geocoder = new google.maps.Geocoder();

        var latlng = new google.maps.LatLng(-34.5450455, -58.48764299999999);
        var mapOptions = {
          zoom: 8,
          center: latlng,
          mapTypeId: google.maps.MapTypeId.ROADMAP
        }
        map = new google.maps.Map(document.getElementById('map_canvas'), mapOptions);

        addMarkers(agenciesMap());
      }

      
      function agenciesAssigned() {
        var zipcode = document.getElementById('zipcode').value;
       
        var agenciesByZip = agenciesByZipcode()[zipcode];
        var agencies = agenciesMap();

        //console.log(zipcode, agenciesByZip);

        if(agenciesByZip != null) {

            var assignedAgencies = {};

            for (var i = 0; i < agenciesByZip.length; i++) {
                var agencyId = agenciesByZip[i];
                assignedAgencies[agencyId] = agencies[agencyId];
            };
            addMarkers(assignedAgencies);

        }else{
            alert("No hay agencias asignadas para ese codigo postal")
            addMarkers({});
        }


        //addAddress(document.getElementById('address').value);
      }


      function addMarkers(agMap){
        
        var marker, i;
        
        deleteOverlays()
        
        for (var agencyId in agMap) {  
          var agency = agMap[agencyId];  
          addMarker(agency, i++);
        }
      }

    function addMarker(agency, i) {
     
      marker = new google.maps.Marker({
          position: new google.maps.LatLng(agency.geo[0], agency.geo[1]),
          map: map
      });

        google.maps.event.addListener(marker, 'click', (function(marker, i) {
            return function() {
            
            //console.log(agency);

              infowindow.setContent(agency.details.toString());
              infowindow.open(map, marker);
            }
      })(marker, i));

      markersArray.push(marker);
    }

    // Removes the overlays from the map, but keeps them in the array
    function clearOverlays() {
      if (markersArray) {
        for (i in markersArray) {
          markersArray[i].setMap(null);
        }
      }
    }

    // Shows any overlays currently in the array
    function showOverlays() {
      if (markersArray) {
        for (i in markersArray) {
          markersArray[i].setMap(map);
        }
      }
    }

    // Deletes all markers in the array by removing references to them
    function deleteOverlays() {
      if (markersArray) {
        for (i in markersArray) {
          markersArray[i].setMap(null);
        }
        markersArray.length = 0;
      }
    }
